body {
    background: url("http://www.desktopimages.org/preview/get_photo/473965/1920/1080") #000 no-repeat fixed center;
    color: #dedede;
}

a {
    color: #adad;
}
a:hover {
    color: #afa;
}

#page .container-fluid {
    background: url("https://echstreme.de/gfx/chstrm/trans-80.png");
    border: 1px dashed #adad;
}

.list-post,
#menu-featured-posts {
    background: url("https://echstreme.de/gfx/chstrm/trans-50.png") !important;
